        return _symbol;
    }

    /**
     * @return the number of decimals of the token.
     */
    function decimals() public view returns (uint8) {
        return _decimals;
    }
}","keccak256":"0x2d7a29545c70b713fc35d2cb3ba477c18be401d0ad5ebc124100635caf091afe","license":"UNLICENSED"},"contracts/IERC20.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
