    */
    function decreaseAllowance(address spender, uint subtractedValue) public whenNotPaused override returns (bool success) {
        return super.decreaseAllowance(spender, subtractedValue);
    }
}","keccak256":"0x79bd347ba017c6f9a0eb5a0240c3c1d3da35ad63a9e8699de46607d41d6860d4","license":"UNLICENSED"},"contracts/IERC20.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
